import NumberInput from './NewNumber';

function Form(props) {

  return (
    <form>
      <NameInput nameInput = {(event) => props.handleNameChange(event)}/>
      <NumberInput numberInput = {props.handleName}/>
      <button onSubmit={props.addPerson}></button>
    </form>
  );
  }

export default Form
